import React, { Component } from 'react';
import { Switch,Route,Link } from 'react-router-dom';
import Main from './Main';

class PlaceHolder extends Component {
    constructor()
    {
        super()
    }

    render() {
        return (
            <div>
                <Switch>
                    <Route exact path="/" component={Main}/>
                </Switch>
            </div>
        );
    }
}

export default PlaceHolder;
